import React from "react";
import { Container, Grid } from "@mui/material";
import SearchBar from "./components/SearchBar";
import RepoTable from "./components/RepoTable";
import RepoDetails from "./components/RepoDetails";

const App: React.FC = () => {
  return (
    <Container>
      <Grid>
        <Grid item xs={10}>
          <SearchBar />
        </Grid>
        <Grid item xs={8}>
          <RepoTable />
        </Grid>
        <Grid item xs={4}>
          <RepoDetails />
        </Grid>
      </Grid>
    </Container>
  );
};

export default App;
